import './Delete.css';
import RetuRnLogo from './Logo';
import ReturnPhone from './Phone';
import ReturnQuote from './Quote';
import ReturnBtn from './Btn';
import Media from 'react-media';


// Return Delete Component 
export default function ReturnDeleTe() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-delete'>
  <VieWDeleTe />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-delete'>
  <VieWDeleTe />
 </div>
);
export const VieWDeleTe = () => (
 <>
  <RetuRnLogo />
  <ReturnPhone />
  <ReturnQuote />
  <ReturnBtn />
 </>
);
